import React from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import Formulario from './Formulario'
const App = () => {
  return (
    <Router>
        <Routes>
          <Route exact path="/" element={<Formulario/>}/>
        </Routes>
    </Router>
  );
}



export default App
